import React from 'react';

const logoutPage=()=>{
    return(
        <div>
             <h1>Your session has been expired.</h1>
             <h1>Please login again.</h1>
             <h4>You will be automatically redirected to HOME PAGE</h4>       
        </div>
    )
};
export default logoutPage;
